import React from "react";
import { IonPage, IonHeader, IonToolbar, IonTitle } from "@ionic/react";

var Component = React.Component;
var CanvasJSReact = require('./canvasjs.react');
var CanvasJS = CanvasJSReact.CanvasJS;
var CanvasJSChart = CanvasJSReact.CanvasJSChart;

interface registoAvaliacao {
    data: Date,
    peso: number
}

class Evolucao extends React.Component {

    state: {
        values: Array<registoAvaliacao>
    }

    constructor(props: any) {

        super(props);        

        this.state = ({
            values: new Array<registoAvaliacao>()
        });
    }

    componentDidMount() {

        this.state.values.push({data: new Date(2020, 0, 2), peso: 98});
        this.state.values.push({data: new Date(2020, 3, 25), peso: 95});
        this.state.values.push({data: new Date(2020, 6, 11), peso: 87});
        this.state.values.push({data: new Date(2020, 9, 9), peso: 86});
        this.state.values.push({data: new Date(2020, 12, 23), peso: 86});
    }

    render() {

        const options = {
            animationEnabled: true,
			exportEnabled: true,
			theme: "light2", // "light1", "dark1", "dark2"
			title:{
				text: "Bounce Rate by Week of Year"
			},
			axisY: {
				title: "Bounce Rate",
				includeZero: false,
				suffix: "%"
			},
			axisX: {
				title: "Week of Year",
				prefix: "W",
				interval: 2
			},
			data: [{
				type: "line",
				toolTipContent: "Week {x}: {y}%",
				dataPoints: [
					{ x: 1, y: 64 },
					{ x: 2, y: 61 },
					{ x: 3, y: 64 },
					{ x: 4, y: 62 },
					{ x: 5, y: 64 },
					{ x: 6, y: 60 },
					{ x: 7, y: 58 },
					{ x: 8, y: 59 },
					{ x: 9, y: 53 },
					{ x: 10, y: 54 },
					{ x: 11, y: 61 },
					{ x: 12, y: 60 },
					{ x: 13, y: 55 },
					{ x: 14, y: 60 },
					{ x: 15, y: 56 },
					{ x: 16, y: 60 },
					{ x: 17, y: 59.5 },
					{ x: 18, y: 63 },
					{ x: 19, y: 58 },
					{ x: 20, y: 54 },
					{ x: 21, y: 59 },
					{ x: 22, y: 64 },
					{ x: 23, y: 59 }
				]
			}]
        }

        return(

            <IonPage>

                <IonHeader>
                    <IonToolbar color="primary">
                        <IonTitle id="page-title">Evolução</IonTitle>
                    </IonToolbar>
                </IonHeader>
            <div>
                <CanvasJSChart options = {options} />
            </div>

            </IonPage>

        );
    }

}

export default Evolucao;
